window.onload = () => {
    const vm = new Vue({
        el: '#app',
        data: () => {
            return {
                loading: false,
                currUrl: '#',
                y: 0,
                tip: ''
            }
        },
        computed: {
            currVideo: function () {
                return mainUrl + this.currUrl
            }
        },
        methods: {
            touchstart (e) {
                this. y = e.touches[0].clientY
            },
            touchend (e) {
                const y2 = e.changedTouches[0].clientY
                if (this.y - y2 >= 50) {
                    this.nextVideo()
                }
            },
            nextVideo () {
                if (this.loading) return
                this.loading = true
                this.tip = '下个视频准备中(3)'
                setTimeout(() => {
                    this.loading = false
                }, 3000)
                setTimeout(() => {
                    this.tip = '下个视频准备中(2)'
                }, 1000)
                setTimeout(() => {
                    this.tip = '下个视频准备中(1)'
                }, 2000)
                const min = 0
                const max = list.length
                const index =  Math.round(Math.random() * (max - min))
                this.currUrl = list[index]
                setTimeout(() => {
                    this.$refs.video.load()
                }, 0)
            }
        },
        mounted () {
            this.nextVideo()
        }
    })
}